import './css/estilos.css';
import Home from './components/pages/Home';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch
} from 'react-router-dom'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Home> </Home>
      </div>
    );
  }
}

export default App;
